import React, { useState, useEffect } from "react";
import axios from "axios";
import VerticalGraph from "./VerticalGraph";
import "./Holding.css"; // Import the updated CSS

const Holdings = () => {
  const [allHoldings, setAllHoldings] = useState([]);

  // Fetch data from the backend
  useEffect(() => {
    axios
      .get("http://localhost:3002/allHoldings")
      .then((res) => {
        console.log("Holdings data:", res.data); // Log to inspect the data structure
        setAllHoldings(res.data);
      })
      .catch((error) => {
        console.error("Error fetching holdings data:", error);
      });
  }, []);

  // Prepare chart data based on the holdings data
  const labels = allHoldings.map((stock) => stock.name);
  const chartData = {
    labels,
    datasets: [
      {
        label: "Stock Price",
        data: allHoldings.map((stock) => Number(stock.price) || 0), // Ensure number
        backgroundColor: "rgba(54, 162, 235, 0.5)",
        borderColor: "rgba(54, 162, 235, 1)",
        borderWidth: 1,
      },
    ],
  };

  return (
    <div className="holdings-container">
      <h3 className="title">Holdings ({allHoldings.length})</h3>

      {/* Table Section */}
      <div className="table-section">
        <table className="orders-table">
          <thead>
            <tr>
              <th>Instrument</th>
              <th>Qty.</th>
              <th>Avg. Cost</th>
              <th>LTP</th>
              <th>Cur. Val</th>
              <th>P&L</th>
              <th>Net chg.</th>
              <th>Day chg.</th>
            </tr>
          </thead>
          <tbody>
            {allHoldings.map((stock, index) => {
              // Ensure numeric values with fallback
              const qty = Number(stock.qty) || 0;
              const avg = Number(stock.avg) || 0;
              const price = Number(stock.price) || 0;
              const net = Number(stock.net) || 0; // Convert net to number with fallback
              const day = Number(stock.day) || 0; // Convert day to number with fallback

              const curValue = price * qty;
              const profitLoss = curValue - (avg * qty);
              const isProfit = profitLoss >= 0;
              const profClass = isProfit ? "profit" : "loss";
              const dayClass = day >= 0 ? "profit" : "loss"; // Assuming day is a number or percentage

              return (
                <tr key={index}>
                  <td>{stock.name || "N/A"}</td>
                  <td>{qty}</td>
                  <td>{avg.toFixed(2)}</td>
                  <td>{price.toFixed(2)}</td>
                  <td>{curValue.toFixed(2)}</td>
                  <td className={profClass}>{profitLoss.toFixed(2)}</td>
                  <td className={profClass}>{net.toFixed(2) || "0.00"}</td> {/* Use formatted net */}
                  <td className={dayClass}>{day.toFixed(2) || "0.00"}%</td> {/* Use formatted day with % */}
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>

      {/* Stats Section */}
      <div className="row">
        <div className="col">
          <h5>29,875.<span>55</span></h5>
          <p>Total Investment</p>
        </div>
        <div className="col">
          <h5>31,428.<span>95</span></h5>
          <p>Current Value</p>
        </div>
        <div className="col">
          <h5>1,553.40 (+5.20%)</h5>
          <p>P&L</p>
        </div>
      </div>

      {/* Chart Section */}
      <div className="chart-container">
        <VerticalGraph data={chartData} />
      </div>
    </div>
  );
};

export default Holdings;
